const TaskList = () => {
  const todoTask = useSelector((state) => state.tasks);
  console.log(todoTask);
  return (
    <section>
      <label htmlFor="check-box" />
      <input className="check-box" type="checkbox" />
      {todoTask}
    </section>
  );
};

export default TaskList;
